import { SET_NUMBER,RESET_NUMBER } from './types';

export const setNumber = (number) => ({
  type: SET_NUMBER,
  payload: number,
});

export const resetNumber = () => ({
  type: RESET_NUMBER,
});
export const decrementNumber = (newNumber) => ({
  type: DECREMENT_NUMBER,
  payload: newNumber,
});
